## Background

Within the United States (US), the Environmental Protection Agency (EPA) classifies 1,4-Dioxane (1,4-DX) as a probable carcinogen, regulating it as a hazardous air pollutant.&lt;sup&gt;1&lt;/sup&gt; 

A two-year animal inhalation study reports that heavy exposure to 1,4-DX is associated with nasal squamous cell carcinomas, hepatocellular adenomas, and peritoneal mesotheliomas in rats.&lt;sup&gt;2&lt;/sup&gt;

.footnote[
[1] Technical Fact Sheet  1,4-Dioxane. In: Management OoLaE, ed: United Sates Environmental Protection Agency; 2017.&lt;/br&gt;
[2] Kasai T, Kano H, Umeda Y, et al. Two-year inhalation study of carcinogenicity and chronic toxicity of 1,4-dioxane in male rats. Inhal Toxicol. 2009;21(11):889-897.
]

---
## Background

Although 1,4-DXs reactivity as an air pollutant is not fully understood, experimental data suggest that ambient 1,4-DX may degrade into immediate byproducts such as aldehydes (formaldehyde, acetaldehyde), organic acids (formic, glycolic, oxalic), ethylene glycol, and glycol ethers.&lt;sup&gt;3&lt;/sup&gt;  

Furthermore, 1,4-DX is an emerging water contaminant that has been detected in over 20% of the US drinking water supplies.&lt;sup&gt;4&lt;/sup&gt; 

&lt;/br&gt;

__Importance:__ No data exist that examine the association between 1,4-DX and the risk of breast cancer in humans. 

.footnote[
[3] Stefan MI, Bolton JR. Mechanism of the Degradation of 1,4-Dioxane in Dilute Aqueous Solution Using the UV/Hydrogen Peroxide Process. Environmental Science &amp; Technology. 1998;32(11):1588-1595.&lt;/br&gt;
[4] Godri Pollitt KJ, Kim J-H, Peccia J, et al. 1,4-Dioxane as an emerging water contaminant: State of the science and evaluation of research needs. Science of The Total Environment. 2019;690:853-866.
]

---
## Study Aims

__Primary Aim:__ To determine whether exposure to 1,4-DX is associated with breast cancer incidence. 

__Secondary Aim:__ To help mature literature and evidence on impact of 16 other common air pollutants associated with breast cancer incidence.  

__Study Design:__ This ecological study examines the association between air pollution and age-adjusted breast cancer incidence. Data for 2,692 U.S. counties are drawn from the 2008 National Emissions Inventory and the 2013-2017 U.S. Cancer Statistics. 

---
## Results

The median age-adjusted breast cancer incidence for 2013-2017 was 121 cases per 100,000 people (IQR: 107.3-132.8) across 2,692 counties. 

The median uninsured rate for females under 65 years old is 9.3% (IQR: 6.4-12.9), and each percent increase in the uninsured is associated with a 1.26 per 100,000 people decrease in breast cancer incidence (P &lt; 0.01).

## Results

The 2017 1,4-DX map indicates the extent of 1,4-DX emission across the US, demonstrating recent widespread emission along the coasts where major population centers are located (Figure 1). 

The total US 1,4-DX emission decreased by 11% (6,469.85 kg) from 61,000.78 kg in 2014 to 54,530.93 kg in 2017. 

The top five counties with the highest increases in 1,4-DX emissions were Calhoun County in South Carolina, Baltimore County in Maryland, Cumberland and New Hanover Counties in North Carolina, and Cook County in Illinois with (1) emission increases of 5114 kg, 1106 kg, 1095 kg, 1038 kg, and 551 kg, and (2) age-adjusted breast cancer incidence of 132.3, 141.9, 131.2, 139.2, 131.7, and 130.9 cases per 100,000 people, respectively. 

The top five counties with the highest increases in 1,4-DX all reported breast cancer incidence higher than the median incidence of 121 cases per 100,000 people.

---
## Discussion

Our study provides the strong evidence for an association between 1,4-DX and breast cancer in humans. Our analysis indicates that 1,4-DX is significantly associated with breast cancer incidence from an ecological viewpoint, which is consistent with 1,4-DXs classification as a probable carcinogen and its recently-reported association with shortened telomeres that threaten genomic integrity.

As previously indicated, we detected significant associations between eight other pollutants [antimony, arsenic, chromium (VI), cumene, lead, manganese, nickel, and nitrogen oxides] and breast cancer incidence. 

To the best of our knowledge, our study is also the most extensive US-based ecological effort to screen environmental pollutants for breast cancer incidence by analyzing their association with breast cancer incidence. 

Prior to our study, the largest breast cancer ecological study was a 2005 study limited to Texas counties, which only identified one significant pollutant (styrene) as a potential risk factor for breast cancer after multivariate analyses of twelve pollutants.

---
## Limitation and Recommendations 

Our study&#39;s most significant limitation is the possibility of ecological fallacy, a well-established limitation associated with the ecological study design, so caution should be applied when interpreting our results. Other key limitations are the limited time window we used to establish chemical exposure due to limited data availability, and information bias within the NEI database as pollutant emissions are self-reported by state, local, and tribal air agencies.

We conclude that exposure to air pollutants is associated with breast cancer. 

Our specific findings suggest that metallic pollutants could play a larger role in breast cancer carcinogenesis than previously thought. More studies should be performed to confirm our ecological findings. 

We recommend long-term epidemiological studies with exposomic approaches to ascertain the cumulative effects of long-term pollution exposure on breast cancer incidence.

  var i, text, code, codes = el.getElementsByTagName('code');
  for (i = 0; i < codes.length;) {
    code = codes[i];
    if (code.parentNode.tagName !== 'PRE' && code.childElementCount === 0) {
      text = code.textContent;
      if (/^\\\((.|\s)+\\\)$/.test(text) || /^\\\[(.|\s)+\\\]$/.test(text) ||
          /^\$\$(.|\s)+\$\$$/.test(text) ||
          /^\\begin\{([^}]+)\}(.|\s)+\\end\{[^}]+\}$/.test(text)) {
        code.outerHTML = code.innerHTML;  // remove <code></code>
        continue;
      }
    }
    i++;
  }
};
slideshow._releaseMath(document);
</script>
